import React, { Fragment } from 'react';
import { Router } from '@reach/router';

import Bike from './components/bike';
import Bikes from './components/bikes';

export default function App() {
  return (
    <Fragment>
        <Router primary={false} component={Fragment}>
          <Bikes path="/" />
          <Bike path="/:id" />
        </Router>
    </Fragment>
  );
}
